import React, { useState, useEffect } from 'react';

function GuestPage() {
    const [screeningsData, setScreeningsData] = useState({});

    useEffect(() => {
        fetch('http://localhost:8080/screenings/allScreeningIdsByMovies')
            .then(response => response.json())
            .then(data => {
                setScreeningsData(data);
            })
            .catch(error => console.error(error));
    }, []);

    return (
        <div className="guest-page">
            <h1>Welcome as Guest</h1>
            <h2>Screenings:</h2>
            {Object.entries(screeningsData).map(([movieTitle, screeningInfos]) => (
                <div key={movieTitle} className="movie-container">
                    <h3>{movieTitle}</h3>
                    {/* Access movie details from screeningInfos[0].movie (assuming structure) */}
                    <p>Genre: {screeningInfos[0].movie.genre}</p>
                    <p>Release Year: {screeningInfos[0].movie.releaseYear}</p>
                    {/* ... other movie details */}
                    <h4>Screening Times:</h4>
                    <ul>
                        {screeningInfos.map(screeningInfo => (
                            <li key={screeningInfo.id}>
                                <p>{screeningInfo.startTime} ({screeningInfo.roomName})</p>
                            </li>
                        ))}
                    </ul>
                </div>
            ))}
        </div>
    );
}

export default GuestPage;
